import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Home from './components/Home';
import Navbar from './components/Navbar';
import TaskState from './components/TaskState';

function App() {
  return (
    <TaskState>
      <Router>
      <Navbar/>
      <Routes>
        <Route path='/' element={<Home />} />
      </Routes>
    </Router>
    </TaskState>
  );
}

export default App;
